import anime from "../images/anime."
function Footer(){
   return(
       <div class="footer">
        <div> </div>
         <img src={musa} alt="" />
           <div class= "footerheader">
           <h1>This is Footer</h1> 
           </div>

       </div>
   
   )
}
export default Footer
